package Builder;

public class Director {
    private Builder builder;

    public Director(Builder builder) {
        this.builder = builder;
    }

    public Product constructProduct() {
        builder.buildName();
        builder.buildCategory();
        builder.buildPrice();
        builder.buildManufacturer();
        return builder.getProduct();
    }

    public Product buildGamingPC() {
        builder.reset();
        builder.setName("PC Gaming Enthusiast");
        builder.setCategory("Gaming PC");
        builder.setPrice(3999.00);
        builder.setManufacturer("Custom Build");
        return builder.getProduct();
    }

    public Product buildOfficePC() {
        builder.reset();
        builder.setName("PC Office Productivity");
        builder.setCategory("Office PC");
        builder.setPrice(899.00);
        builder.setManufacturer("Custom Build");
        return builder.getProduct();
    }
}

